    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 519,
           NT_OFFSET         = 123,
           LA_STATE_OFFSET   = 5697,
           MAX_LA            = 2147483647,
           NUM_RULES         = 523,
           NUM_NONTERMINALS  = 198,
           NUM_SYMBOLS       = 321,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 2612,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 119,
           EOLT_SYMBOL       = 119,
           ACCEPT_ACTION     = 4952,
           ERROR_ACTION      = 5174;

